INSERT INTO `product` VALUES (16,NULL,'9421901167004',NULL,'诺丽酵素原浆750ml','Life Health Noni Juice  750ml','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,1.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:05:44','2018-09-18 11:05:44',NULL,NULL,0,NULL,NULL,NULL),(17,NULL,'9421008702740',NULL,'龙血小银瓶30ml','drangon‘s blood sculpting serum 30ml','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:05:44','2018-09-18 11:05:44',NULL,NULL,0,NULL,NULL,NULL),(18,NULL,'4210201146575',NULL,'电动牙刷(多角度)','oral-b electric toothbrush （cross action）','attachment/img/2018-10-13/oralb电动牙刷.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p>1：一个充电器（座充，感应充电）</p>\r\n\r\n<p>2：一个机身，也就是刷柄</p>\r\n\r\n<p>3：此款牙刷自带2个刷头。</p>\r\n\r\n<p>4：说明书一份（英文）&nbsp;</p>\r\n\r\n<p>5、有2分钟自动提醒功能。</p>\r\n\r\n<p>6、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</p>\r\n\r\n<p>7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</p>\r\n\r\n<p>【注意事项】</p>\r\n\r\n<p>1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</p>\r\n\r\n<p>2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</p>\r\n\r\n<p>3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。刷头德国制造，刷柄和插座中国制造，小伙伴们请知悉！</p>\r\n','','','2018-09-18 11:05:44','2018-09-18 11:05:44','NZ','',0,NULL,'',''),(19,NULL,'9310297005628',NULL,'洛神红酒750ml','Rawson‘s retreat 750ml','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:05:44','2018-09-18 11:05:44',NULL,NULL,0,NULL,NULL,NULL),(20,NULL,'9311770598170',NULL,'Swisse 大钙 澳洲版本150粒','Swisse Calcium and Vitamin D 150c','attachment/img/2018-10-13/Swisse大钙01.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(1).jpg\" style=\"width: 790px; height: 871px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(2).jpg\" style=\"width: 790px; height: 1159px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/swisse%E9%92%99%20(