><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新澳医生推荐Pamol宝宝发烧退烧止疼液(1岁以上适合，包括成人</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">) 100ml<br />\r\n强烈推荐！</font></font></font><span style=\"font-size:36px\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新西兰每个有孩子的家庭都有备，没有布洛芬,没有抗生素，没有激素，没有依赖性，非常安全有效。</font></font></font></span><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">本产品不同于国内的退烧药美林，因为美林所含的布洛芬是新西兰和澳洲禁用的成分,而Pamol是新澳医生推荐本地宝宝的退烧药。</font></font></font><br />\r\n<br />\r\n<font size=\"3\"><font color=\"#000000\"><font face=\"微软雅黑\">布洛芬对于儿科而言是不安全的，它会引起肾脏损害，特别是由于腹泻引起的发烧，如果处在脱水状态引起的肾脏损害还更加严重，甚至是不可逆的，往往家长本身是不能正确判定宝宝是否处于脱水状态，因此该药物在澳大利亚和新西兰严禁给婴幼儿使用！在中国目前没有相关法律，但请中国的爸妈们注意，不要给宝宝服用含有布洛芬的药物！）</font></font></font><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">Pamol</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">发烧止痛无色素口服液迅速退烧、舒缓牙疼，耳痛，接种预防针之后，头疼及感冒或发烧引起的各种疼痛。药性温和，适合宝宝幼嫩的肠胃。无人工添加素，每次只需少量，保护小宝宝的娇小幼嫩的胃。口味是宝宝喜欢的草莓和橙子味道，没有添加任何糖份，妈妈喂得省心宝宝吃的放心。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">【用法用量】</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">请参照宝宝的体重或月龄适量喂食</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">1岁-5岁：2.5-5.0ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">6岁-10岁：5.0-7.5ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">10岁-12岁：7.5-10ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">12岁以上/成人：10-20ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-使用前，请摇匀溶液，用滴管量取需要份量。直接喂食或与果汁或水混合后喂食。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-注意，每次使用后，用热水消毒滴管。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-每4-6小时服食一次。一天或24小时内不可超过4次。如症状还无减轻或加重，请立即带宝宝咨询医生。不可以服用超过48小时。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-开瓶后请放置于阴凉处，避免日光直晒。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-请不要把药品放在宝宝能接觸到的地方。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">-请在使用前仔细阅读产品包裝上的说明书。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">-本品不含：布洛芬，糖，阿司匹林，酒精，人工色素。</font></font></font></span></span></span></span></span></span></p>\r\n','','','2018-09-18 11:05:53','2018-09-18 11:05:53','NZ','',0,NULL,'',''),(128,NULL,'9319733001903',NULL,'Anthisan蚊虫止痒药25