、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</p>\r\n\r\n<p>7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</p>\r\n\r\n<p>【注意事项】</p>\r\n\r\n<p>1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</p>\r\n\r\n<p>2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</p>\r\n\r\n<p>3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。刷头德国制造，刷柄和插座中国制造，小伙伴们请知悉！</p>\r\n','','','2018-09-18 11:06:11','2018-09-18 11:06:11','NZ','',0,NULL,'',''),(339,NULL,'9342905001173',NULL,'freeze frame 睫毛膏 8ml','Freezeframe Tint&Grow 8ml','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:11','2018-09-18 11:06:11',NULL,NULL,0,NULL,NULL,NULL),(340,NULL,'9400569019153',NULL,'好健康 蜂胶胶囊 300粒','Good Health Propolis 300s','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:11','2018-09-18 11:06:11',NULL,NULL,0,NULL,NULL,NULL),(341,NULL,'9400569014554',NULL,'好健康 液体钙 150粒','Good Health Hi Cal 1000mg 150s','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:11','2018-09-18 11:06:11',NULL,NULL,0,NULL,NULL,NULL),(342,NULL,'9400575001159',NULL,'THOMPSONS 血糖管理片 60粒','Thompson Glucose Manager 60t','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:11','2018-09-18 11:06:11',NULL,NULL,0,NULL,NULL,NULL),(343,NULL,'9421025564703',NULL,'go health 葡萄籽 120粒','go healthy grape seed 60000mg 120c','',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:12','2018-09-18 11:06:12',NULL,NULL,0,NULL,NULL,NULL),(344,NULL,'9316542111458',NULL,'NATIO 乳液 125ml','Natio Moisturising Face Lotion 125ml','attachment/img/2018-10-03/Natio 月见草面部保湿乳液 125ml.jpg',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:12','2018-09-18 11:06:12',NULL,NULL,0,NULL,NULL,NULL),(345,NULL,'9311770598156',NULL,'Swisse 睡眠片 100粒','Swisse Sleep 100s','attachment/img/2018-10-13/swisse睡眠片 (2).jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p><img 