-14/Aerogard%20%E9%98%B2%E8%9A%8A%E5%96%B7%E9%9B%BE175ml%2001.jpg\" style=\"width: 814px; height: 6013px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Aerogard%20%E9%98%B2%E8%9A%8A%E5%96%B7%E9%9B%BE175ml%2002.jpg\" style=\"width: 814px; height: 5238px;\" /></p>\r\n','','','2018-09-18 11:06:15','2018-09-18 11:06:15','NZ','',0,NULL,'',''),(392,NULL,'4210201829416',NULL,'Oral-B 电动牙刷（精密）','Oral-B Vitality Precision Clean','attachment/img/2018-10-13/oralb电动牙刷.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p>1：一个充电器（座充，感应充电）</p>\r\n\r\n<p>2：一个机身，也就是刷柄</p>\r\n\r\n<p>3：此款牙刷自带2个刷头。</p>\r\n\r\n<p>4：说明书一份（英文）&nbsp;</p>\r\n\r\n<p>5、有2分钟自动提醒功能。</p>\r\n\r\n<p>6、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</p>\r\n\r\n<p>7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</p>\r\n\r\n<p>【注意事项】</p>\r\n\r\n<p>1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</p>\r\n\r\n<p>2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</p>\r\n\r\n<p>3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。刷头德国制造，刷柄和插座中国制造，小伙伴们请知悉！</p>\r\n','','','2018-09-18 11:06:16','2018-09-18 11:06:16','NZ','',0,NULL,'',''),(393,NULL,'9349254002028',NULL,'goat 羊奶皂（绿）柠檬100g','Goat Soap Lemon 100g','attachment/img/2018-10-14/goat soap羊奶皂_主图3.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/goat%20soap%E7%BE%8A%E5%A5%B6%E7%9A%8201.jpg\" style=\"width: 814px; height: 6277px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/goat%20soap%E7%BE%8A%E5%A5%B6%E7%9A%8202.jpg\" style=\"width: 814px; height: 5819px;\" /></p>\r\n','','','2018-09-18 11:06:16','2018-09-18 11:06:16','NZ','',0,NULL,'',''),(394,NULL,'9420015017052',NULL,'ecostore 宝宝身体乳 200ml','Ecostore Baby Moisture 200ml','attachment/img/2018-10-04/宝宝身体乳_主图2.jpg',0,1,1,0,0,1,0,0,0,0,0,NULL,0,1,0.00,NULL,0.00,0,NULL,'',NULL,NULL,'2018-09-18 11:06:16','2018-09-18 11:06:16',NULL,NULL,0,NULL,NULL,NULL),(395,NULL,'9350634002859',NULL,'Unichi 美白丸 60粒','Unichi rosehip Extract Complex 60s','attachment/img/2018-10-14/Unichi 玫瑰果油美白胶囊 60粒保质期202008.png',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Unichi%E7%BE%8E%E7%99%BD%E4%B8%B8%20(1).jpg\" style=\"width: 900px; height: 485px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Unichi%E7%BE%8E%E7%99%BD%E4%B8%B8%20(2).jpg\" style=\"width: 900px; height: 2086px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-14/Unichi%E7%BE%8E%E7%99%BD%E4%B8%B8%20(3).jpg\" style=\"width: 900px; height: 1650px;\" /></p>\r\n','','','2018-09-18 11:06:16','2018-09-18 11:06:16','NZ','',0,NULL,'',''),(396,NULL,'9331134927811',NULL,'PAMOL 一岁以上退烧药橙子味200ml','pamol relieves children‘s pain&fever 1-12岁 orange 200ml','attachment/img/2018-10-14/PAMOL 一岁以下退烧药橙子味200ml.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新澳医生推荐Pamol宝宝发烧退烧止疼液(1岁以上适合，包括成人</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">) 100ml<br />\r\n强烈推荐！</font></font></font><span style=\"font-size:36px\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">新西兰每个有孩子的家庭都有备，没有布洛芬,没有抗生素，没有激素，没有依赖性，非常安全有效。</font></font></font></span><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">本产品不同于国内的退烧药美林，因为美林所含的布洛芬是新西兰和澳洲禁用的成分,而Pamol是新澳医生推荐本地宝宝的退烧药。</font></font></font><br />\r\n<br />\r\n<font size=\"3\"><font color=\"#000000\"><font face=\"微软雅黑\">布洛芬对于儿科而言是不安全的，它会引起肾脏损害，特别是由于腹泻引起的发烧，如果处在脱水状态引起的肾脏损害还更加严重，甚至是不可逆的，往往家长本身是不能正确判定宝宝是否处于脱水状态，因此该药物在澳大利亚和新西兰严禁给婴幼儿使用！在中国目前没有相关法律，但请中国的爸妈们注意，不要给宝宝服用含有布洛芬的药物！）</font></font></font><br />\r\n<br />\r\n<font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">Pamol</font></font></font><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">发烧止痛无色素口服液迅速退烧、舒缓牙疼，耳痛，接种预防针之后，头疼及感冒或发烧引起的各种疼痛。药性温和，适合宝宝幼嫩的肠胃。无人工添加素，每次只需少量，保护小宝宝的娇小幼嫩的胃。口味是宝宝喜欢的草莓和橙子味道，没有添加任何糖份，妈妈喂得省心宝宝吃的放心。</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">【用法用量】</font></font></font></span></span></span></span></span></span></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font color=\"#000000\"><font size=\"3\"><font face=\"微软雅黑\">请参照宝宝的体重或月龄适量喂食</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span style=\"line-height:21px\"><span style=\"color:#404040\"><span style=\"background-color:#ffffff\"><span style=\"color:#351c75\"><font face=\"微软雅黑\"><font size=\"3\"><font color=\"#000000\">1岁-5岁：2.5-5.0ml</font></font></font></span></span></span></span></span></span></strong></p>\r\n\r\n<p align=\"left\" style=\"margin:1.12em 0px; padding:0px\">&nbsp;</p>\r\n\r\n<p align=\"left\" style=\"margin:7.5pt 0cm 0pt; padding:0px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma, arial, 宋体, sans-serif\"><span s