"width: 790px; height: 542px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/4.jpg\" style=\"width: 790px; height: 372px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/5.jpg\" style=\"width: 787px; height: 591px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/6.jpg\" style=\"width: 790px; height: 502px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/7.jpg\" style=\"width: 790px; height: 337px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/8.jpg\" style=\"width: 790px; height: 522px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/9.jpg\" style=\"width: 790px; height: 726px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/10.jpg\" style=\"width: 790px; height: 488px;\" /></p>\r\n','','','2018-09-18 11:06:24','2018-09-18 11:06:24','NZ','',0,NULL,'',''),(512,NULL,'4210201856191',NULL,'oral-B 电动牙刷（敏感）','Oral-B Vitality Plus sensitive','attachment/img/2018-10-13/oralb电动牙刷敏感7.jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p>【产品信息】</p>\r\n\r\n<p><span style=\"color:#3498db;\"><strong>敏感型（VITALITY）适合敏感型</strong></span></p>\r\n\r\n<p>针对怕冷，出血等牙齿！刷毛最柔软！</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>牙刷刷毛最柔软，最温和，适合牙龈敏感.有牙周疾病.刷牙容易流血的人群。内含1个充电器.1个刷柄.2个刷头.说明书。优点：2分钟提醒功能，机身防水，自动感应充电，不会过度充电。连续充电16个小时可以充满，一次充电使用约5天。每分钟高达7600次2D刷动。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#f1c40f;\">1：一个充电器（座充，感应充电）</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">2：一个机身，也就是刷柄</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">3：此款牙刷自带2个刷头。</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">4：说明书一份（英文）&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">5、有2分钟自动提醒功能。</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">6、此型号牙刷防水和不会过充，可以放在卫生间使用，不用的时候可以随时插在充电座上保持满电。</span></p>\r\n\r\n<p><span style=\"color:#f1c40f;\">7、连续充电16个小时可以充满，之后可以使用大概5天（每天刷牙2次，每次2分钟）。</span></p>\r\n\r\n<p>【注意事项】</p>\r\n\r\n<p>1.&nbsp;建议每三个月换一次刷头，第一是为了保证刷牙效果，第二是因为牙刷其实也挺容易脏的，即时更换可以避免细菌的侵袭，保持口腔健康！</p>\r\n\r\n<p>2.&nbsp;这个澳洲的产品，都是三角插的，所以家里没有三角插的，注意用一个转换插头啊！</p>\r\n\r\n<p>3.&nbsp;牙刷是100%德国原装进口，采购于澳洲超市。<span style=\"color:#f1c40f;\">刷头德国制造，刷柄和插座中国制造</span>，小伙伴们请知悉！</p>\r\n','','','2018-09-18 11:06:24','2018-09-18 11:06:24','NZ','',0,NULL,'',''),(513,NULL,'9369998011605',NULL,'koehl 龙珠洁面球（粉色）','Koehl Cleansing Ball-Lime Caviar(Pink)','attachment/img/2018-10-10/龙珠洁面球 (5).jpg',0,1,1,0,0,1,NULL,NULL,NULL,NULL,0,NULL,0,1,10.00,NULL,0.00,0,NULL,'<p><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc2.jpg\" style=\"width: 750px; height: 934px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc3.jpg\" style=\"width: 750px; height: 680px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc4.jpg\" style=\"width: 750px; height: 965px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc5.jpg\" style=\"width: 750px; height: 871px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc6.jpg\" style=\"width: 750px; height: 823px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc7.jpg\" style=\"width: 750px; height: 859px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc8.jpg\" style=\"width: 750px; height: 931px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koehl%20%E9%BE%99%E7%8F%A0%E6%B4%81%E9%9D%A2%E7%90%83_desc10.jpg\" style=\"width: 750px; height: 634px;\" /><img alt=\"\" src=\"http://yomi.co.nz/attachment/article/2018-10-13/koeh